import "./UserList.css"

const UserList = ({ socket }: any) => {
	const [userList, setUserList] = useState<{id: string, room: string}[]>();

	useEffect(() => {
	  socket.on("UserList", (newUser:{id: string, room: string}[]) => {
		setUserList(newUser);
	  });

	  return () => {
		socket.disconnect();
	  };
	}, [socket]);


	return (
		<div className="UserList-box">
			<div className="UserList-container">
